import React, { useState } from 'react';
import axios from 'axios';

const Login = () => {
    const BASE_URL = 'http://localhost:8080';
    const [user, setUser] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = e => {
        e.preventDefault();
        const data = {userName: user, password: password};
        axios.post(`${BASE_URL}/Login`, data)
        .then(response => {
            console.log(user + " " + password + ' ' + response);
        })
        .catch((error) => {
            console.log(error);
          });
    }

    const handleUserChange = user => {
        setUser(user);
    };

    const handlePasswordChange = password => {
        setPassword(password);
    };

    return (
        <div>
            <h1>Login</h1>
            <form onSubmit={handleSubmit}>
                <label>User Name: 
                    <input type="text" id="username" value={user} onChange={e => handleUserChange(e.target.value)}/>
                </label>
                <br/>
                <label>Password: 
                    <input type="password" id="password" value={password} onChange={e => handlePasswordChange(e.target.value)}/>
                </label>
                <br/>
                <input type="submit" value="Submit"/>
            </form>
            <h3>- or -</h3>
            <h2>Create Account</h2>
        </div>
    );
};
export default Login;
